description:
London and Edinburgh

Culture, Travel Documentary hosted by Anthony Bourdain and published by Discovery Channel broadcasted as part of DC No Reservations series in 2008 - English narration

London-and-Edinburgh-Cover.jpg

Information
------------------------------

There is something alluring and menacing in the air throughout the UK when it comes to the people, the scenery, and especially the cuisine, and Tony is off to try and discover what that mystique is.

